var myImage =
  "data:image/jpeg;base64,";
  
window.onload = function() {
  FBInstant.initializeAsync().then(function() {
    // Start loading game assets here
    console.log("Loading...");

    FBInstant.startGameAsync().then(function() {
      var contextId = FBInstant.context.getID();
      var contextType = FBInstant.context.getType();

      var playerName = FBInstant.player.getName();
      var playerId = FBInstant.player.getID();

      fetch("https://food-society.herokuapp.com/api/instant-game/send-cache/", {
        method: "POST",
        headers: {
          "Content-Type": "application/json; charset=utf-8"
        },
        body: JSON.stringify({ group_id: contextId, user_id: playerId })
      }).then(() => {
        setInterval(function() {
          fetch(
            `https://food-society.herokuapp.com/api/instant-game/get-exit-status/${contextId}/${playerId}/`
          )
            .then(res => res.json())
            .then(res => {
              if (res.exit_status) {
                return FBInstant.updateAsync({
                  action: "CUSTOM",
                  cta: "Participate",
                  text: `${playerName} just confirmed for the event!`,
                  template: "test_template",
                  image: myImage,
                  data: { myReplayData: "..." },
                  strategy: "IMMEDIATE",
                  notification: "NO_PUSH"
                }).then(function() {
                  // closes the game after the update is posted.
                  FBInstant.quit();
                });
              }
            });
        }, 1000);
      });
      game.start();
    });
  });
};
